import React, { Component } from 'react'
import Logo from '../Assets/Logo.png'
import HomeScreen from './HomeScreen'


export default class TitleScreen extends Component {

    state = { 
        titleScreen: true,
        story: false
    }

    loadHomeScreen = () => {
        console.log('hello')
        this.setState({
            story: true
        })
    }

    render(){
        if(this.state.titleScreen === true){
            return(
                <div className='title-screen-background'>
                    <div className='logo-container' style={{display: {}}}>
                            <button onClick={() => this.loadHomeScreen()}><img src={Logo}/></button>
                    </div>
                </div>
            )
        }
        else{
            return(
                <HomeScreen/>
            )
        }

    }
}
